package fpl.soa.stockservice.service;

import fpl.soa.stockservice.DTO.CategoryWithQuantity;
import fpl.soa.stockservice.entities.Category;
import fpl.soa.stockservice.repository.CategoryRepo;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Service;

import java.util.List;
import java.util.UUID;

@Service
public class CategoryServiceImpl implements CategoryService {

    @Autowired
    private CategoryRepo categoryRepo;

    @Override
    public List<CategoryWithQuantity> findCategoriesWithProductsQuantity() {
        return categoryRepo.getCategoriesWithProductsQuantity();
    }


    @Override
    public Category createCategory(Category category) {
        return this.categoryRepo.insert(category);
    }

    @Override
    public Category updateCategory(Category category) {
        Category saved = this.categoryRepo.save(category);
        return saved;
    }

    @Override
    public void deleteCategory(String categoryId) {
        this.categoryRepo.deleteById(categoryId);
    }

    @Override
    public void initCategory() {
        if (categoryRepo.count() == 0) {
            List<Category> initialCategories = List.of(
                    Category.builder()
                            .categoryId("Category_1")
                            .categoryName("Phones")
                            .categoryColors(List.of("Black", "White", "Silver", "Space Gray", "Midnight", "Starlight", "Blue", "Green", "Pink", "Gold", "Red", "Purple", "Graphite", "Deep Purple", "Natural Titanium", "Blue Titanium", "White Titanium", "Black Titanium"))
                            .categorySizes(List.of("32GB", "64GB", "128GB", "256GB", "512GB"))
                            .categoryImageBase64("data:image/jpeg;base64,")
                            .build(),

                    Category.builder()
                            .categoryId("Category_2")
                            .categoryName("Clothes")
                            .categoryColors(List.of("Black", "White", "Navy", "Gray", "Charcoal", "Red", "Burgundy", "Pink", "Beige", "Brown", "Olive", "Green", "Forest Green", "Blue", "Sky Blue", "Purple", "Lavender", "Yellow", "Orange", "Khaki", "Cream"))
                            .categorySizes(List.of("XS", "S", "M", "L", "XL", "XXL", "XXXL"))
                            .categoryImageBase64("data:image/jpeg;base64,")
                            .build(),

                    Category.builder()
                            .categoryId("Category_3")
                            .categoryName("Shoes")
                            .categoryImageBase64("data:image/jpeg;base64,")
                            .build()
            );

            categoryRepo.saveAll(initialCategories);
            System.out.println(" Categories initialized.");
        } else {
            System.out.println(" Categories already exist. Skipping init.");
        }
    }
}
